DOWN GOES THE CHAMP! Luke Breedlove takes down two time champ Steve Plascencia to win Event 3 of the @xballofficial 1v1 series at @scvillage 

I THINK a lot of people are scared to play 1v1. I KNOW that a lot of the players I grew up with cherished the opportunity to push themselves and compete in any fashion. The guys that came to play this @xballofficial 1v1 put up one hell of a fight, every single one of them. Cheers to all the new and familiar faces that made this event a great time once again. Thank you to the staff of @scvillage 

@pupgalvez23 @rounder11 @groezy86_paintball @steve75p @luke_breedlove @childishchecho @tom.cross__ @_swashbuckler_ @jayson.urmson9k @kay__breezy @althethird @chiweenie484100 @3dubem_dsb @beardegidio @hollywoodsports @giantsandiego @giantpartysports @his.panick @asylvia @giodegidio

Absolutely stoked and honored to represent Kansas City Missouri @themissouriallstars for the 1v1 elite Hormesis Paintball championship October 22nd at sc village California.

The Duel : what an amazing fun new format that will change the future of paintball as we know it i am so invested into the new idea and thankful for @oliverwhitecloud , @alexfraige @kevodotcom Billy D Robertson III @mikko358 and @hormesispaintball for bringing this format to light! 

I had to travel to Florida to compete in the 4th stop along the tour i ended up taking 2nd place 👎🏻 

I then traveled to California to SC Village Paintball and Airsoft Park competed again taking first 🏆 and earning my spot among the top 8 of the world for semi pro players and under. 

A huge shout out to the few people helping me a long the way with practice Coaching and everything in between. 

@joeyblute coaching and teaching me a few very valuable things that has helped changed my game for good and also just following up with me and continuing to give me advice much love brother! 

@swaggyk23 helping in a big way during the Florida duel. Along with @marky_son 

@toddmartinez for everything from tents chairs paint coaching me and always keeping the vibes good during the joust and duel in California. 

@hinman.michael coaching me during the duel at sc village i truly believe If he wasn’t in my corner for my match against my currently teammate Clayton long i would have lost the match a big thank you to him and @mattymarshallsd for stepping in during that match to fire me up. 

Matt Edens Cameron Long Morgan Oliphant Jacob Downing Jon Ladwig for helping me practice the 1v1 countless times and my coach Leon Wunsch for always hyping me up and keeping me going in my lows 

Big thank you to a long time hero of mine for driving me further in paintball then i could of imagined. And helping me grind every bit of the way @therealclaylong7 

Last but not least my beautiful wife @morganboyer94 for everything you are an amazing loving and supportive wife couldn’t do any of it with out you.

